import React from "react";
import MyGridContainer from "../MyGridContainer";
import { useStyles } from "../style";
import TopBarHomeItems from "./TopBarHomeItems";
import TopBarHomeAuth from "./TopBarHomeAuth";
import { Divider } from "@material-ui/core";

function TopBarHome() {
  const classes = useStyles();
  return (
    <>
      {/* Middle */}
      <MyGridContainer className={classes.headData} item lg={8}>
        <TopBarHomeItems className={classes.headDataItems} />
      </MyGridContainer>
      {/* Login/ Sign in */}
      <Divider />
      <MyGridContainer item lg={3} spacing={2}>
        <TopBarHomeAuth />
      </MyGridContainer>
    </>
  );
}

export default TopBarHome;
